import React from 'react';
import style from './Rolls.module.css';
import {NavLink} from "react-router-dom";
import Types from "./Types/Types";
import {Route, Routes, BrowserRouter} from "react-router-dom";
import Index from "../Index/Index";
import HotRolls from "./HotRolls/HotRolls";
import ColdRolls from "./ColdRolls/ColdRolls";


type productType = {
    name: string,
    description: string,
    src: string,
    price: number,
    weight: number,
    type: string
};

type rollsType = {
    cold: Array<productType>,
    hot: Array<productType>,
    baked: Array<productType>
}
let rolls: rollsType = {

}



const Rolls = (props: any) => {
    return (
       <div className="wrapper">
            <h2 className={style.roll_header}>
                Роллы Казань с доставкой
            </h2>
            <Types/>
           <Routes>
               <Route path="hot" element={<HotRolls />}
               />
               <Route path="cold" element={<ColdRolls />}
               />
           </Routes>
            <div className="items">
                {

                    rolls.map((roll: productType) => {
                        return <div className="item">
                            <a href="#" className="popup_link"><img src={`${process.env.PUBLIC_URL}/assets${roll.src}`} alt=""/></a>
                            <h3>{roll.name}</h3>
                            <div className="description">
                                <p>{roll.description}</p>
                                <div className="price">
                                    <div><span>{roll.weight}</span>гр. <br/> <span className="item_price"> {roll.price} </span>₽</div>
                                    <a href="#" className="add_to_cart" data-id="PP6Chic9">в корзину</a>
                                </div>
                            </div>
                        </div>
                    })
                }
            </div>
       </div>
    );
}

export default Rolls;
